import React, {Component} from 'react';

class Home extends Component {
    render() {
        return (
            <div className="contain">
                <p className="section">Find your perfect trip, designed by insiders who know and love their cities.</p>
                <div className="section">
                    <h4>Start browsing</h4>
                    <img className="circle" src={require("../images/circled-right.png")} alt="circle"/>
                </div>
                <p className="section">Want to build your own MYtinerary</p>
                <ul className="section userFunction">
                    <li><a href="https://github.com/phiphan148">Login</a></li>
                    <li><a href="https://github.com/phiphan148">Create Account</a></li>
                </ul>
                <img className="circle" src={require("../images/homeIcon.png")} alt="home icon"/>
            </div>
        );
    }
}

export default Home;
